//Reason:To Find Randoms//
//Made By:SRL           //
//////////////////////////
function QuickRandoms : Boolean;//used by script_owned4 inspired by Nashi
var
 R: Integer;
begin
  for R := 1 to 12 do
  begin
    case R of
      1: if FindDead then
           Result := True;
      2: if FindMod then
           Result := True;
      3: if FindMime then
           Result := True;
      4: if FindMaze then
           Result := True;
      5: if FindQuiz then
           Result := True;
      6: if FindDemon then
           Result := True;
      7: if InBlack then
         begin
           Result := True;
           TerminateScript;
           ProgressReport;
         end;
      8: if NoGameTab then
         begin
           Result := True;
           Writeln('No GameTab.');
           ProgressReport;
           TerminateScript;
         end;
      9 : if RC then//RC, most people don't need.
            Result := True;
      10: if FindTalk then
            Result := True;
      11: if FindFight then
          begin
            RunTo('W', True);
          end;
    end;
    Wait(1);
  end;
end;
