//Reason:To Drog Logs.         //
//Made By:Script_Om wned4        //
/////////////////////////////////
procedure DropLogs;
begin
 if(not(Bank = 'yes'))or(not(Bank = 'Yes'))then
 if(InvFull)then
begin
 GameTab(4);
 Wait(100+Random(40));
 DropAll;
 end;
end;
