//Reason:To Bank Logs.         //
//Made By:Script_Owned4        //
/////////////////////////////////
procedure Banking;
var
  Ax, Ay, N: Integer;
  Colours: TIntegerArray;
  BankColours: string;

begin
 if(Bank = 'yes')or (Bank = 'Yes')then
  begin
   if(InvFull)then
   GetClientDimensions(Ax,Ay);
    GameTab(4);
    if(FindSymbol(x,y,'Bank'))then
   begin
    if(not(FindSymbol(x,y,'Bank')))then
    DropLogs;
   end else
  case LowerCase(BankColours) of
    'BankColour1'  : Colours := [4156042, 2971727, 2439992];
    'BankColour2'  : Colours := [3561845, 486492, 1064758];
    'BankColour3'  : Colours := [4150100, 2974794, 3297881];
   end;
    for N := 0 to 5 do
     begin
      QuickRandoms;
       FindNormalRandoms;
        if FindObjCustom(Ax, Ay, [BankColours, 'Use ' + 'bank.', Copy('Use bank.', 2, Length(Ay))], Colours, N)then
         begin
          Mouse(x,y,2,2,false);
           ChooseOption('Use quickly.');
            end else
           Mouse(x,y,2,2,true);
          Wait(210+Random(70));
         Mouse(720,400,2,2,false);
        ChooseOption('Bank all.');
      Mouse(x,y,2,2,true);
     Wait(300+Random(80));
    CloseBank;
   Mouse(Xcoordinate,Ycoordinate,2,2,true);
  Wait(300+Random(100));
 Wait(210+Random(70));
  end;
 end;
end;
