//Reason:Main Loop(most important part of script).//
//Made By:Script_Owned4                           //
////////////////////////////////////////////////////
begin
Cleardebug;
 SetupSRL;
    GetSelf.WindowState := wsMinimized;
    Login;
    repeat
     repeat
      FindNormalRandoms;
       QuickRandoms;
        Cutting;
         AutoTalking;
         until(InvFull);
         if(TreeToChop = 'tree')then
         if(InvFull)then
         Experience:= Experience + 20;
         if(TreeToChop = 'oak')then
         if(InvFull)then
         Experience:= Experience + 40;
         if(TreeToChop = 'willow')then
         if(InvFull)then
         Experience:= Experience + 80;
       LogsChopped:=LogsChopped + 28;
      FindNormalRandoms;
     QuickRandoms;
    Banking;
   DropLogs;
   Login;
   until(IsFKeyDown(FKey));
  ProgressReport;
end.[/code]
